import React, { useState } from 'react'
import {Avatar, Button, CssBaseline, TextField, FormControlLabel, Link, Grid, Typography, Container, Box} from '@mui/material';
import { useHistory } from 'react-router-dom';
import { useAuth } from './Auth';

function LoginWithGoogle({onGoogleLogin}) {
    const Auth = useAuth();
    // const history = useHistory();

    const handleLoginWithGoogle = () => {
      //Redirect SpringBoot backend Oauth endpoint
      window.location.href = `${process.env.API_BASE_URL}/oauth2/authorization/google?redirect_uri=${process.env.OAUTH2_REDIRECT_URI}`;
    };

    return (
    <div>
      <Container component='main' maxWidth='xs'>
        <CssBaseline />
        <Box sx={{marginTop:8, display: 'flex', flexDirection:'column', alignItems:'center'}}>
          <Typography component='h1' variant='h5'>
            Sign in
          </Typography>
          <Box sx={{mt:3}}>
            <Button fullWidth sx={{backgroundColor: '#A2B575', color: 'white'}} onClick={handleLoginWithGoogle}>Sign in with Google</Button>
          </Box>
        </Box>
      </Container>
    </div>
    );
}
export default LoginWithGoogle;
